import Container from 'react-bootstrap/Container'

// Layout general de las pantallas
const Layout = props => (
  <Container className="justify-content-center pt-4 col-xl-12 col-lg-11 col-md-10 col-xs-5">
    {props.children}
    </Container>
);

export default Layout;
